description:
Category	Feature, Couples

Director	Stormy Daniels
Starring	Kaylani Lei, Michael Vegas, Samantha Saint, Capri Cavanni, Gia Dimarco, TJ Cummings, Rilynn Rae, Chad Alva

After a wild Las Vegas bachelor party, Tracey's (Kaylani Lei) best friend, John, winds up in jail. Being a good friend, she gets in her car (with her ex) and takes a roadtrip to bail him out. Once out of jail, the insanity really starts - including trying to get his wedding ring back from an angry stripper - and getting him to the aisle on time! Fun and sexy - The Ring will leave you screaming, 'I Do!'

